import React from 'react';
import {Todo} from './Todo'

export class TodoList extends React.Component {

    constructor(props) {
        super(props);
    }
    
    render(){
        const list = this.props.todoList;
        const listItems = list.map((item) =>
            <Todo
                text={item.text}
                priority={item.priority}
                dueDate={item.dueDate}  
            />
        );
        return (
          <ul>{listItems}</ul>
        );
    }
}
